import { NavLink } from "react-router-dom";
import "./Navbar.css";

const NavMenu = () => {
    const activeClass = "active-menu-item";
    return (

        <nav className="topNav">
            <ul>
                <li><NavLink activeClassName={activeClass} to="/" exact>Home</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/nutrition-analysis">Nutrition analysis</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/recipes">Recipes</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/mbi">MBI</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/articles">Articles</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/sign-up">Sign up</NavLink></li>
                <li><NavLink activeClassName={activeClass} to="/sign-in">Sign Ip</NavLink></li>
            </ul>
        </nav>

    )
}

export default NavMenu;
